import React from 'react'
import styled from 'styled-components'
const Navbar = styled.div`

    height: 50px;
    background-color: blue;

`
const Nav = () => {
    return (
        <div>
            <Navbar><h1>Hello</h1></Navbar>
        </div>
    )
}

export default Nav
